import React from "react";
import Todo from './Todo';

const TodoList = (props) => {

    const {todos, toggleComplete} = props;

    return (
        <li>
          {todos.map(todo => (
            <Todo key={todo.id} {...todo} toggleComplete={toggleComplete} />
          ))}
        </li>
      );

};

export default TodoList;
